import React, { useState } from "react";
import { ChevronLeft, MapPin, Plus, MoreHorizontal } from "lucide-react";
import { Card, CardContent } from "@/components/ui/card";
import { Button } from "@/components/ui/button";
import { Input } from "@/components/ui/input";
import { Separator } from "@/components/ui/separator";
import { Calendar } from "@/components/ui/calendar";
import {
  Popover,
  PopoverContent,
  PopoverTrigger,
} from "@/components/ui/popover";
import { cn } from "@/lib/utils"; // Assuming you have this utility

const TravelPlanner = () => {
  const [isSidebarCollapsed, setSidebarCollapsed] = useState(false);
  const [budget, setBudget] = useState(0);
  const [selectedDate, setSelectedDate] = useState(new Date("2024-02-21"));
  const [places, setPlaces] = useState([]);

  const handleAddPlace = (placeName) => {
    if (placeName.trim() !== "") {
      setPlaces([...places, placeName.trim()]);
    }
  };

  return (
    <div className="flex h-screen w-screen">
      {/* Sidebar */}
      <div
        className={cn(
          "h-screen bg-white border-r border-gray-200 transition-all duration-300 overflow-hidden",
          isSidebarCollapsed ? "w-0" : "w-80"
        )}
      >
        {/* Logo and Nav */}
        <div className="flex justify-between items-center p-4 border-b border-gray-200">
          <span className="text-xl font-bold">Travel Planner</span>
          <Button
            variant="ghost"
            size="icon"
            onClick={() => setSidebarCollapsed(!isSidebarCollapsed)}
          >
            <ChevronLeft className="h-4 w-4" />
          </Button>
        </div>

        {/* Main Navigation */}
        <div className="p-4 space-y-4">
          <span className="font-semibold">Overview</span>
          <div className="space-y-2">
            <Button variant="ghost" className="w-full justify-start">
              Notes
            </Button>
            <Button variant="ghost" className="w-full justify-start">
              Places to visit
            </Button>
          </div>

          {/* Date Section */}
          <div className="mt-8 space-y-4 p-4">
            <Popover>
              <PopoverTrigger className="font-semibold">
                {selectedDate.toLocaleDateString("en-US", {
                  weekday: "long",
                  month: "long",
                  day: "numeric",
                })}
              </PopoverTrigger>
              <PopoverContent className="p-4">
                <Calendar
                  mode="single"
                  selected={selectedDate}
                  onSelect={setSelectedDate}
                />
              </PopoverContent>
            </Popover>

            <Card>
              <CardContent className="p-4 space-y-2">
                <div className="flex items-center space-x-2">
                  <MapPin className="h-4 w-4" />
                  <Input
                    placeholder="Add a place"
                    className="border-0 focus:ring-0 flex-grow"
                    onKeyDown={(e) => {
                      if (e.key === "Enter") {
                        handleAddPlace(e.target.value);
                        e.target.value = "";
                      }
                    }}
                  />
                  <Button
                    variant="ghost"
                    size="icon"
                    onClick={() => {
                      const input = document.querySelector(
                        'input[placeholder="Add a place"]'
                      );
                      if (input) {
                        handleAddPlace(input.value);
                        input.value = "";
                      }
                    }}
                  >
                    <Plus className="h-4 w-4" />
                  </Button>
                </div>

                {/* Display added places */}
                <ul className="list-disc pl-6 space-y-1">
                  {places.map((place, index) => (
                    <li key={index}>{place}</li>
                  ))}
                </ul>
              </CardContent>
            </Card>
          </div>

          {/* Budget Section */}
          <div className="mt-8 space-y-4 p-4">
            <span className="font-semibold">Budgeting</span>
            <Card>
              <CardContent className="p-4 space-y-4">
                <span className="text-2xl font-bold block">
                  ${budget.toFixed(2)}
                </span>
                <div className="flex space-x-2">
                  <Button variant="outline" size="sm" className="flex-1">
                    Set budget
                  </Button>
                  <Button variant="outline" size="sm" className="flex-1">
                    Debt summary
                  </Button>
                </div>
                <Separator />
                <div className="flex justify-between">
                  <Button variant="ghost" size="sm">
                    View breakdown
                  </Button>
                  <Button variant="ghost" size="sm">
                    Add tripmate
                  </Button>
                  <Button variant="ghost" size="sm">
                    Settings
                  </Button>
                </div>
              </CardContent>
            </Card>
          </div>
        </div>
      </div>

      {/* Map Area */}
      <div className="flex-1 bg-gray-100 relative">
        <div className="absolute inset-0 flex items-center justify-center">
          <span className="text-gray-500">Map view would go here</span>
        </div>
      </div>
    </div>
  );
};

export default TravelPlanner;
